import Card from "../Card/Card"
import style from "./CardsContainer.module.css"; 
import { useSelector } from "react-redux";
//tomo el array de dogs y por cada dog renderizar un componente Card

const CardsContainer =()=>{     //este es un componente Smart || tiene la logica
   const  dogs = useSelector(state=>state.dogs)  
    return (
        <div className= {style.container}>
            {dogs.map(dog=>{
                return <Card   //cards recibe props de afuera 
                key={dog.id}
                id={dog.id}
                name={dog.name}
                weight={dog.weight}
                height={dog.height}
                life_span={dog.life_span}
                temperament={dog.temperament}
                image={dog.image}




                />

            })}

        </div>
    )

}

export default CardsContainer
